package practice2;

public class practice2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=1;
		while(i<=4)
		{
			int j=5;
			while(j<i)
			{
				System.out.print("1");
				System.out.print(" ");
				j=j-1;
			}
			System.out.print("\n");
			i=i+1;
		}
	}

}
